import React from "react";

class Footer extends React.Componenet {
  render() {
    return (
      <div className="footer-container">
        <div classname="footer-logos" />
        <p>Keep Showing Up LLC</p>
        <p>2019</p>
      </div>
    );
  }
}

export default Footer;
